import App from './App';
import Art from './Art';
import './Header.css';
import { BrowserRouter as Router, Route,Routes } from 'react-router-dom';

function Header() {
  return (

<div className="App">
<Router>
<Routes>

  <Route exact path="/" component={App} >scsd</Route>
  <Route path="/about" component={App} />
  <Route path="/Software" component={App} />
  <Route path="/Art" component={Art} />
  <Route path="/Contact" component={Art} />
</Routes>
</Router></div>

  );
}

export default Header;
